import React, { Component } from "react";
import { Jumbotron, Container } from "reactstrap";

class Home extends Component {
  state = {};

  render() {
    return (
      <div>
        <Container>
          <Jumbotron>
            <h1>Price Expense Tracker</h1>
            <hr />
            <p>
              This application allows users to create an account and add/delete
              expenses to existing categories.
            </p>
            <p>Users are also allowed to add new categories.</p>
            <p>And admin account is provided for testing purposes.</p>
          </Jumbotron>
        </Container>
      </div>
    );
  }
}

export default Home;
